<div id="rwnkmg-popup-box-960-preview-{{num}}" class="popupally-pro-outer-960-preview-rwnkmg-{{num}} popupally-pro-outer-preview-background-rwnkmg-{{num}}">
	<div class="popupally-pro-inner-rwnkmg-{{num}}">
		<div popupally-preview-linked="rwnkmg-config-image-1-960-{{num}}" class="image-1-pro-rwnkmg rwnkmg-preview-image-1-{{num}}" id="rwnkmg-preview-image-1-960-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-image-2-960-{{num}}" class="image-2-pro-rwnkmg rwnkmg-preview-image-2-{{num}}" id="rwnkmg-preview-image-2-960-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-headline-960-{{num}}" class="desc-pro-rwnkmg rwnkmg-preview-headline-{{num}}" id="rwnkmg-preview-headline-960-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-textbox-1-960-{{num}}" class="textbox-1-pro-rwnkmg rwnkmg-preview-textbox-1-{{num}}" id="rwnkmg-preview-textbox-1-960-{{num}}"></div>
		<div popupally-preview-linked="rwnkmg-config-textbox-2-960-{{num}}" class="textbox-2-pro-rwnkmg rwnkmg-preview-textbox-2-{{num}}" id="rwnkmg-preview-textbox-2-960-{{num}}"></div>
		<input popupally-preview-linked="rwnkmg-config-name-input-960-{{num}}" type="text" class="field-pro-rwnkmg-name rwnkmg-preview-name-{{num}}" {{rwnkmg-preview-hide-name}} id="rwnkmg-preview-name-960-{{num}}" name="name" placeholder="{{rwnkmg-name-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-lname-input-960-{{num}}" type="text" class="field-pro-rwnkmg-lname rwnkmg-preview-lname-{{num}}" {{rwnkmg-preview-hide-lname}} id="rwnkmg-preview-lname-960-{{num}}" name="lname" placeholder="{{rwnkmg-lname-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-email-input-960-{{num}}" type="email" class="field-pro-rwnkmg-email rwnkmg-preview-email-{{num}}" id="rwnkmg-preview-email-960-{{num}}" name="email" placeholder="{{rwnkmg-email-placeholder}}"/>
		<input popupally-preview-linked="rwnkmg-config-subscribe-button-960-{{num}}" type="button" class="submit-pro-rwnkmg no-click-through rwnkmg-subscribe-button-{{num}}" id="rwnkmg-subscribe-button-960-{{num}}" value="{{rwnkmg-subscribe-button-text}}"/>
	</div>
</div>